e-1\">","            <ul class=\"nav navbar-nav\">","              <li><a href=\"introduction.php\">Introduction</a></li>","              <li><a href=\"#\">Recipes</a></li>","              <li><a href=\"#\">Ingredients</a></li>","            </ul>","            <form class=\"navbar-form navbar-right\" role=\"search\">","              <div class=\"form-group\">","                <input type=\"text\" class=\"form-control\" placeholder=\"Search for recipes...\">","              </div>","              <button type=\"submit\" class=\"btn btn-default\">Submit</button>","            </form>","          </div><!-- /.navbar-collapse -->","        </div><!-- /.container -->","      </nav>","      <div class=\"intro\">","        <div class=\"container\">","          <h1>Keto in a Nutshell</h1>","          <p class=\"introLead\">Version 3, Updated 2012-06-09</p>","        </div>","      </div>","    <div class=\"container\">","      <br><br>","      <div class=\"intro_box\">","        <h2>What is a ketogenic diet?</h2>","        <p>","          A Ketogenic Diet is any diet that causes ketones to be produced by the liver, shifting the body’s metabolism away from glucose towards fat utilization. Typically on a moderate to high carb diet, the body will prefer glucose for fuel (usually from dietary carbs), but by restricting carbs, the body will prefer fat for fuel. By inducing ketosis, a series of adaptations will take place.","        </p>","        <p>","          Ketosis is also an effective way to control your blood sugar. When you eat something high in carbohydrates, your body produces insulin to get rid of all the sugar in your blood. But since there is already carbs to be used for fuel, your body will be storing fat cells and not releasing any to be burned. So by reducing carbs and being in ketosis, your insulin levels will be regulated at a lower level, and your body will want to access your body fat for fuel instead. In most cases this means impressive weight-loss!","        </p>","        <p>","          With controlled blood sugar levels, you will experience less hunger and cravings. Paired with an adequate protein and high fat intake, you will feel both satisfied and satiated by the diet.","        </p>","      </div>","    </div>","    <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/1.11.2/jquery.min.js\"></script>","    <script src=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/js/bootstrap.min.js\"></script>","  </body>","</html>"]}]}]]},"ace":{"folds":[],"scrolltop":0,"scrollleft":7.5,"selection":{"start":{"row":76,"column":7},"end":{"row":76,"column":7},"isBackwards":false},"options":{"guessTabSize":true,"useWrapMode":false,"wrapToView":true},"firstLineState":0},"timestamp":1429501575713,"hash":"6449d9d3070a654c9b455823f77b0325445b56cb"}